import React,{useState} from 'react'
import {Link} from 'react-router-dom'
function Navbar() {
    return (
        <>
           <Link to="/">Home                </Link>
           <Link to="/AddLink">Add Links   </Link>
           <Link to="/Arrange">Arrange links   </Link>
           <Link to="/PlayVideo">Play videos   </Link>
        </>
    )
}

export default Navbar
